import React from 'react'

const Contacts = ({ setCoords }) => {
  return (
    <div onMouseOver={event => setCoords(event)}>
      <h1>Kontakty</h1>
      <p>Nebojte se, budeme vas kontaktovat</p>
    </div>
  )
}

export default Contacts
